import Layout from '../components/Layout.js';
import Link from 'next/link';

const PostCountry = (props) => (
    <div>
        <Link as={`/${props.id}`} href={`/selectedCountry?countryName=${props.title}`}>
            <a>{props.title}</a>
        </Link>
    </div>
);

export default () => (
    <Layout>
        <div>
            <h1>index.js</h1>
            <hr></hr>
                <PostCountry id='country1' title='Greece' />
                <PostCountry id='country2' title='South Africa' />
                <PostCountry id='country3' title='The UK' />
        </div>
    </Layout>
);
